import React from "react";

const BlogPosts = ({posts, loading}) => {
  if (loading) {
    return <h2>Loading...</h2>;
  }

  return ( 
    <div>
      <ul>{posts.map(post  => (
        <div>
          <li key={post.id}>{post.title}</li>
          <li>{post.body}</li>
        </div>
      ))}
      </ul>
    </div>

  );
};

export default BlogPosts;
